import "../css/shop.css";
import TopNav from "../../top_nav_comp/js/topNav";
import Verants from "../../verants_comp/js/verants";
export default function ShopPage() {
  return (
    <div className="shop-page-main-container">
        <TopNav shop={true} />;
        <div className="shop-main-items-container">
          <div className="shop-item shop-main-bundel-item">
            <div className="shop-price-main-container">
              <div className=""></div>
              <div>2,050</div>
            </div>
          </div>
          <div className="shop-item shop-item-one"></div>
          <div className="shop-item shop-item-two"></div>
          <div className="shop-item shop-item-three"></div>
        </div>
    </div>
  );
}
